package dk.frv.eavdam.data;import java.util.List;public class AISAtonStationFATDMAChannel extends FATDMAChannel {	private List<AtonMessageBroadcastRate> atonMessageBroadcastList;	public AISAtonStationFATDMAChannel() {		super();	}		public AISAtonStationFATDMAChannel(String channelName) {		super(channelName);	}	public AISAtonStationFATDMAChannel(String channelName, List<AtonMessageBroadcastRate> atonMessageBroadcastList) {		super(channelName);		this.atonMessageBroadcastList = atonMessageBroadcastList;	}		public List<AtonMessageBroadcastRate> getAtonMessageBroadcastList() {		return atonMessageBroadcastList;	}		public void setAtonMessageBroadcastList(List<AtonMessageBroadcastRate> atonMessageBroadcastList) {		this.atonMessageBroadcastList = atonMessageBroadcastList;	}}